# Data validators
class DataValidator:
    @staticmethod
    def validate_duns(duns: str) -> bool:
        return duns.isdigit() and len(duns) == 9

    @staticmethod
    def validate_ppop(ppop: str) -> bool:
        valid_ppops = {"A", "B", "C"}
        return ppop in valid_ppops

    @staticmethod
    def validate_zip(zip_code: str) -> bool:
        return (zip_code.isdigit() and len(zip_code) == 5) or (
            len(zip_code) == 10 and zip_code[5] == '-'
        )

